function playPause(){var a=document.getElementById("video1");if(a.paused){document.title="Video Playing";a.play()}else{document.title="PowerOffice Training - Projects Module";a.pause()}}function restart(){var a=document.getElementById("video1");a.pause();a.currentTime=0;a.load();a.play()}function rewind(){var a=document.getElementById("video1");a.pause();a.currentTime=a.currentTime-5;a.play()}function fastForward(){var a=document.getElementById("video1");a.pause();a.currentTime=a.currentTime+5;a.play()}function makeBig(){var a=document.getElementById("video1");a.width=1280;a.height=720;document.getElementById("makeBig").style.display="none";document.getElementById("makeSmall").style.display="inline"}function makeSmall(){var a=document.getElementById("video1");a.width=320;a.height=220;document.getElementById("makeBig").style.display="inline";document.getElementById("makeSmall").style.display="none"}function gotoEnd(){var a=document.getElementById("video1");a.pause();a.currentTime=a.duration;a.pause}function openDashboard(){var a=document.getElementById("video1");window.location.href="Dashboard/"};